    public static Project load(String contractAddress, Client client, CryptoKeyPair credential) {
        return new Project(contractAddress, client, credential);
    }

    public static Project deploy(Client client, CryptoKeyPair credential, List<String> managers) throws ContractException {
        String encodedConstructor = FunctionEncoder.encodeConstructor(Arrays.<Type>asList(managers.isEmpty()? DynamicArray.empty("address[]"):new DynamicArray<Address>(
                        org.fisco.bcos.sdk.abi.Utils.typeMap(managers, Address.class))));
        return deploy(Project.class, client, credential, getBinary(client.getCryptoSuite()), encodedConstructor);
    }
